    augmented_arr = []
    for i in range(len(arr)):
        if i == 0 or arr[i] != arr[i - 1]:
            augmented_arr.append((arr[i], i, i))
        else:
            augmented_arr[-1] = (augmented_arr[-1][0], augmented_arr[-1][1], i)
